import React from 'react';

interface ContainerProps { }

class AbsherHome extends React.Component<ContainerProps> {

  constructor(props: ContainerProps) {
    super(props);
    this.openQRPage = this.openQRPage.bind(this);
  }
  openQRPage(e:any) {
    e.preventDefault();
    history.push('/dashboard/users/1');
  }

  render() {
    return (
      <div className="container">
        <img src="assets/absher-home.jpeg" onClick={e => this.openQRPage(e)}></img>
      </div>
    );
  };
};

export default AbsherHome;
